    type: http
    url: https://raw.githubusercontent.com/tahmaseb73/ClashFactory/main/providers/Grenada.txt
    interval: 3600
    path: ./providers/Grenada.txt
    health-check:
      enable: true
      interval: 3600
      url: "https://www.gstatic.com/generate_204"
